import './App.css';

function App() {
  return (
    <nav className='navbar navbar-expand-lg navbar-dark main-color py-3'>
      <div className='container-fluid'>
        <span className='navbar-brand'> Luv 2 </span>

        <a className='navbar-brand' href='/'>Navbar</a>
      </div>
    </nav>
  );
}

export default App;
